    false,nt"url": null,nt"notes": "Up0dens is a polygon shapefile representing
    5 minute x 5 minute latitude x longitude cells that contain the overall, combined
    densities (birds/sq km), of 76 species of marine birds in the CDAS central CA data
    set, for the Upwelling Season (March15-August14). The number of marine birds seen
    in a cell was divided by the area sampled in the cell to estimate density. If a
    cell was censused more than once, densities were averaged. Cells that were surveyed
    but in which no birds were observed have densities of zero.",nt"license_title":
